class Solution {
public:
    int findClosestNumber(vector<int>& nums) {
        int diff=INT_MAX;
        int j=0;
        sort(nums.begin(),nums.end());
        for(int i=0;i<nums.size();i++){

            if(abs(nums[i])<=diff){
                diff=abs(nums[i]);

                j=i;
            }
        }
        return nums[j];
    }
};
